Trouble rendering of documents with referenced fields on Vue.js mongoose<p>Recently, I picked up Vue.js and Mongoose to develop a personal project to mainly track Ingredients' on hand quantities on a certain online game.</p>
<p><a href="https://i.stack.imgur.com/H5D63.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/H5D63.png" alt="App image" /></a></p>
<p>Different dishes require different ingredients. <code>Lotus Seed - Bird Egg soup, Jewelry Soup</code> and <code>Jade Parcels</code> all require different number of <code>Lotus Head</code> as its ingredients.
I update an ingredient's quantity by using <code>updateOne</code> on ingredients collection.</p>
<p>Unfortunately, I originally embedded the ingredients on foods / dishes, which I realized problematic
recently, coz literally you just count ingredients what you currently have.</p>
<p>So a food document now looks like this</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;5fca4ada32195d5814510242&quot;),
    &quot;foodName&quot; : &quot;Lotus Seed and Bird Egg Soup&quot;,
    &quot;onHandQty&quot; : 20,
    &quot;ingredients&quot; : [ 
        &quot;5fca481432195d581451023f&quot;, 
        &quot;5fca483932195d5814510240&quot;, 
        &quot;5fca48a232195d5814510241&quot;
    ]
}
</code></pre>
<p>I read about Mongoose's <code>populate()</code>, and tested to output one food/dish. Unfortunately there's nothing coming out of <code>Vue.js</code> front-end after trying that code.</p>
<p>server/models/Food.js</p>
<pre><code>const { Router } = require('express');
const FoodItem = require('../../models/Food');
const IngredientItem = require('../../models/Ingredient');

const router = Router()

router.get('/', async(req, res) =&gt;{
    try {
        const food = await FoodItem.findOne({
            foodName: 'Lotus Seed and Bird Egg Soup'
        }).populate('ingredients').
        exec(function (err, food) {
          if (err) return handleError(err);
          console.log('The food is %s', food.foodName);
        });
        res.send(food);
    } catch (error) {
        res.status(500).json({
            message: error.message
        })
    }
});

module.exports = router
</code></pre>
<p>A portion of component where ingredients are rendered</p>
<p>client/src/components/Food.vue</p>
<pre><code>&lt;div class=&quot;tile is-ancestor&quot;&gt;
                    &lt;div class=&quot;tile&quot;&gt;
                        &lt;div class=&quot;tile is-parent&quot;&gt;
                            &lt;div class=&quot;tile is-child box&quot;&gt;
                                &lt;template v-if=&quot;food.ingredients&quot;&gt;
                                    &lt;div class=&quot;ingredients-block&quot;&gt;
                                        &lt;p&gt;Ingredients List:&lt;/p&gt;
                                        &lt;ul class=&quot;ingredients-list&quot;&gt;
                                            &lt;li class=&quot;row&quot; v-for=&quot;ingredient in food.ingredients&quot; :key=&quot;ingredient._id&quot;&gt;
                                                &lt;div id=&quot;ingredient-image-container&quot;&gt;
                                                    &lt;img class=&quot;image is-64x64&quot; :src=&quot;require(`../assets/images/food_inv/${ingredient.imagePath}.png`)&quot; alt=&quot;ingredient.ingredientName&quot; :title=&quot;ingredient._id&quot;&gt;
                                                    {{ingredient.ingredientName}}
                                                &lt;/div&gt;
                                                &lt;div class=&quot;required-qty-container&quot;&gt;
                                                    &lt;!-- &lt;i class=&quot;material-icons&quot; id=&quot;required-inner-qty&quot;&gt;food_bank&lt;/i&gt; --&gt;
                                                    Required:
                                                    {{ ingredient.requiredQty }}
                                                &lt;/div&gt;
                                                &lt;div class=&quot;on-hand-qty-container&quot;&gt;
                                                    &lt;p&gt;On Hand:&lt;/p&gt;
                                                    &lt;input v-if=&quot;ingredient.onHandQty &lt; ingredient.requiredQty&quot; class=&quot;input is-danger on-hand-input&quot; type=&quot;number&quot; v-model=&quot;ingredient.onHandQty&quot; min=&quot;0&quot;&gt;
                                                    &lt;input v-else class=&quot;input is-primary on-hand-input&quot; type=&quot;number&quot; v-model=&quot;ingredient.onHandQty&quot; min=&quot;0&quot;&gt;
                                                    &lt;!-- &lt;button class=&quot;button is-primary save-button&quot; @click=&quot;test({ingredient_id: ingredient._id, onhandqty: ingredient.onHandQty})&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;save&lt;/i&gt;&lt;/button&gt; --&gt;
                                                    &lt;button class=&quot;button is-primary save-button&quot; @click=&quot;$emit('update-qtys', {ingredient_id: ingredient._id, onhandqty: ingredient.onHandQty})&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;save&lt;/i&gt;&lt;/button&gt;
                                                &lt;/div&gt;
                                            &lt;/li&gt;
                                        &lt;/ul&gt;
                                    &lt;/div&gt;
                                &lt;/template&gt;
                            &lt;/div&gt;
                        &lt;/div&gt;
                    &lt;/div&gt;
                &lt;/div&gt;
</code></pre>
<p>Whole project on Github: <a href="https://github.com/citrussilver/Food_Inventory" rel="nofollow noreferrer">Food Inventory</a></p>

